try:
        data = json.loads(req_data)
    except json.decoder.JSONDecodeError as e:
        raise TaskException(f"Error parsing JSON: {e}")

    h = blake3.blake3(data.get('key', b''))
    return h.hexdigest(), hashlib.md5(h.digest()).hexdigest()

if not isinstance(req_data, dict):
        raise ValueError('req_data should be a dictionary')
    blake3_hash = blake3.blake3(json.dumps(req_data, sort_keys=True)).hexdigest()
    md5_hash = hashlib.md5(blake3_hash.encode('utf-8')).hexdigest()
    return (blake3_hash, md5_hash)

if not isinstance(req_data, dict):
        raise ValueError("The input must be a dictionary.")
    blake3_hash = blake3.blake3()
    blake3_hash.update(json.dumps(req_data, separators=(',', ':')).encode('utf-8'))
    return (blake3_hash.hexdigest(), hashlib.md5(blake3_hash.digest()).hexdigest())

blake3_hash = blake3.blake3(json.dumps(req_data)).hexdigest()
    md5_hash = hashlib.md5(blake3_hash.encode('utf-8')).hexdigest()
    return (blake3_hash, md5_hash)

md5_hash = hashlib.md5()
    blake3_hash = blake3.blake3()

    for key, value in req_data.items():
        if isinstance(value, dict):
            blake3_hash.update(json.dumps(value, indent=None).encode('utf-8'))
            md5_hash.update(blake3_hash.digest())
        else:
            blake3_hash.update(value.encode('utf-8'))
            md5_hash.update(blake3_hash.digest())

    blake3_hash.update(str(len(req_data)).encode('utf-8'))
    md5_hash.update(blake3_hash.digest())

    return (blake3_hash.hexdigest(), md5_hash.hexdigest())

